import { DataInput } from "./FormStyles";

const FormInput = () => {
  const inputChangeHandler = (event: any) => {
    console.log(event)
  };

  return (
    <>
      <label></label>
      <DataInput type="text" onChange={inputChangeHandler}/>
    </>
  )
};

export default FormInput;
